import React from "react";

class Home extends React.Component {
  render() {
    return (
      <>
        <div className="home__wrap">
          <div className="container">
            <h1>Профессиональный шиномонтаж в Кличеве</h1>
          </div>
        </div>
      </>
    );
  }
}

export default Home;
